        return Locations[_myLocation].managers;
    }
    function getManagersSellers(address _myManager) public view returns(address[] memory){
        require(Managers[_myManager].location == msg.sender);
        return Managers[_myManager].sellers;
    }
    function getMenu(address _manager) public view returns(Menu  memory){
        return LocationMenus[_manager];
    }
    function deleteLocation(address _location) public OperatorAccess{
         for(uint i = 0; i < Operators[msg.sender].locations.length; i++ ){
            if(Operators[msg.sender].locations[i] ==_location){
                delete Operators[msg.sender].locations[i];
            }}
    }
    function deleteManager(address _manager) public LocationAccess{
        for(uint i = 0; i < Locations[msg.sender].managers.length; i++ ){
            if(Locations[msg.sender].managers[i] ==_manager){
                delete Locations[msg.sender].managers[i];
            }}
    }
    function deleteSeller(address _seller) public ManagerAccess{
           for(uint i = 0; i < Managers[msg.sender].sellers.length; i++ ){
            if(Managers[msg.sender].sellers[i] ==_seller){
                delete Managers[msg.sender].sellers[i];
            }}
    }
    function deleteAllLocations() public OperatorAccess{
        delete Operators[msg.sender].locations;
    }
    function deleteAllManagers() public LocationAccess{
        delete Locations[msg.sender].managers;
    }
    function deleteAllSellers() public ManagerAccess{
        delete Managers[msg.sender].sellers;
    }
    function activateSeller(address _seller) public view ManagerAccess{
        require(msg.sender == Sellers[msg.sender].manager);
        Sellers[_seller].active == true;
    }
    function activateSellers(address [] memory _sellers) public view ManagerAccess{
         for (uint i=0; i <Managers[msg.sender].sellers.length; i++){
         if(Managers[msg.sender].sellers[i] ==_sellers[i]){
         Sellers[Managers[msg.sender].sellers[i]].active == true;
         }}
    }
    function deactivateSeller(address _seller) public view ManagerAccess{
        require(msg.sender == Sellers[msg.sender].manager);
        Sellers[_seller].active ==false;

    }
    function deactivateSellers(address [] memory _sellers) public view ManagerAccess{
        for (uint i=0; i <Managers[msg.sender].sellers.length; i++){
         if(Managers[msg.sender].sellers[i] ==_sellers[i]){
         Sellers[Managers[msg.sender].sellers[i]].active == false;
         }}
    }
    function addSale(
        address payable _operator,
        address _seller,
        string memory _items,
        string memory _sellerId,
        string memory _customerLocation,
        string memory _customer,
        uint itemTotal,
        uint _burnAmount
        ) payable public ActiveSeller(_seller){
        require(itemTotal >= msg.value);
        records.push(Record({
            operator: _operator,
            items: _items,
            sellerId: _sellerId,
            customerLocation: _customerLocation,
            customer: _customer
        }));
        uint rate = InterfaceDigi(digitrade).getCurrentRate();
        _burnAmount = SafeMath.mul((div(rate,100000000000000000)),msg.value);
        burn(_burnAmount);
        require(msg.value == itemTotal);
        _operator.transfer(msg.value);
    }
    function burn(uint256 _value) internal {
        InterfaceDigi(digitrade).transfer(InterfaceDigi(digitrade).getBurnAddress(),_value);
    }
    function createOpTimeLock(address _factory) public returns (address Addres)  {
        require(msg.sender == Operators[msg.sender].operator, "Not an operator");
        require(_factory == operatorFactory, "addresses dont match");
        //locks[msg.sender] = new OperatorLock(operatorFactory);
        OperatorLock newContract = new OperatorLock(_factory);
        oplocks.push(newContract);
        Addres = address(newContract);
        Operators[msg.sender].timeLock = Addres;
        return Addres;
    }
    function getOperatorLockContract(address _operator) public view returns(address) {
        return Operators[_operator].timeLock;
    }

}

contract OperatorLock {
        address public  operatorContract;
        //Don't forget to secure strings related to personal data.
        uint public constant MINIMUM_DELAY = 800;//2 hr blocktime
        uint public constant MAXIMUM_DELAY = 1600;
        uint public delay;
        address private _owner;
        bool status;
        event requestOrder(address indexed customer, address indexed seller, uint region);
        event acceptedOrder(address indexed customer, address indexed seller,address indexed driver, uint region);
        event completedOrder(address indexed customer, address indexed seller,address indexed driver);
        address timeLockContract;
        struct openOrders {
            address location;
            address customer;
            address driver;
            string [] items;
            uint total;
            bool accepted;
            string cLocation;
            uint start;
            uint expires;
            uint delayBlocks;
            uint driverPayment;
        }

    struct Asset {address asset; address location; address verifier; bool verified; uint expiration; uint region;}
    mapping(address => Asset) OperatorAssets;
    Asset[] public asset_array;

    openOrders[] public orders;
    mapping(address => openOrders )  public orderMap;

    constructor(address _op)  {
       _owner = msg.sender;
       timeLockContract = address(this);
       setOperatorContract(_op);
    }

    function setOperatorContract(address _operatorContract) internal{
        require(_operatorContract == msg.sender);
        operatorContract = _operatorContract;
    }

    modifier VerifiedAsset(address _asset){
        require(msg.sender == OperatorAssets[_asset].asset);
        _;
    }

    modifier delayBlocks(uint number){
        require(number > MINIMUM_DELAY, "Time period is too short");
        require(number < MAXIMUM_DELAY, "Exceeds maximum time period");
        _;
    }

    modifier activeOrder(address _customer){
        require(block.number < orderMap[_customer].expires, "Order is no longer active");
        _;

    }
    modifier onlyOwner(){
        require(msg.sender==_owner);
        _;
    }

    modifier onlyOpen(){
    require(status == true);
    _;
    }

    function addAsset(address _asset, uint _expiration, uint _region) public{
        Asset memory thisAsset = Asset(_asset, msg.sender, msg.sender, true ,_expiration , _region);
        asset_array.push(thisAsset);
    }
    function getAssetInfo(address _asset) public view returns(Asset memory){
        return OperatorAssets[_asset];
    }
    function getAssets() public view returns(Asset[] memory){
        return asset_array;
    }
    function open(uint _delay) delayBlocks(_delay) public onlyOwner{
        delay = _delay;
        status = true;
    }

    function request(
        address _customer,
        string memory _customerLocation,
        string [] memory _items,
        address _seller,
        uint _total,
        uint region)
        public payable onlyOpen{
            require(msg.value > _total);
            orders.push(openOrders({
            location: _seller,
            customer: _customer,
            driver : 0x000000000000000000000000000000000000dEaD,
            items: _items,
            total:_total,
            accepted: false,
            start:block.number,
            expires:block.number + delay,
            cLocation: _customerLocation,
            delayBlocks: 100,
            driverPayment: 0
        }));

        emit requestOrder(msg.sender,_seller,region);
        InterfaceOperator(operatorContract).transfer(timeLockContract, _total);
    }

    function accept(address _customer, address _location, address _driver, uint _amount) public payable onlyOpen{
        require((block.number - orderMap[_customer].expires)>300, "Not enough time to make this delivery");
        require(_driver == msg.sender || _location == _owner);
        if(_driver == OperatorAssets[_location].asset){
        orderMap[_customer].driver = _driver;
        emit acceptedOrder(_customer, orderMap[_customer].location, _driver, OperatorAssets[_owner].region);
        }
        else{
            require(msg.value == orderMap[_customer].total);
            InterfaceOperator(operatorContract).transfer(timeLockContract,_amount);
            orderMap[_customer].driverPayment == msg.value;
            orderMap[_customer].driver = _driver;
            emit acceptedOrder(_customer, orderMap[_customer].location, _driver, OperatorAssets[_owner].region);
            }

    }

    function complete(address _customer, address _driver) public onlyOwner{
        uint driverhold = orderMap[_customer].driverPayment;
        InterfaceOperator(operatorContract).transfer(_driver, (orderMap[_customer].total+driverhold));
        InterfaceOperator(operatorContract).transfer(_owner, orderMap[_customer].total);
        emit completedOrder(_customer, msg.sender, _driver);
    }

    function cancel(address _customer, address _driver) public onlyOwner onlyOpen activeOrder(_customer){
        InterfaceOperator(operatorContract).transfer(_customer, orderMap[_customer].total);
        if(_driver !=0x000000000000000000000000000000000000dEaD)
        if(_driver != OperatorAssets[_driver].asset)
        InterfaceOperator(operatorContract).transfer(_driver, orderMap[_customer].total);
        delete orderMap[_customer];
    }

    function close() public onlyOwner{
     status = false;
    }




}
